        f) electronically transmitting, by the at least one data source entity, at
        least one file containing the de-identified, matched specific instances and
        corresponding items in the privacy-sensitive transactional data, to an aggregator,
        g) merging, by the aggregator, the at least one file into a combined result
        responsive to the query.<br /> 2. The method of claim 1, wherein the method
        also comprises the step of electronically transmitting, by the aggregator,
        the combined result to at least one data consumer entity having the initial
        set of privacy-sensitive data.<br /> 3. The method of claim 1, wherein the
        step of formulating the query is performed by the aggregator, and the step
        of generating the list is performed by at least one data consumer entity having
        the initial set of privacy-sensitive data, the data consumer entity receiving
        the query from the aggregator.<br /> 4. The method of claim 3, wherein the
        list is transmitted by the at least one data consumer entity directly to the
        at least one data source entity.<br /> 5. The method of claim 3, wherein the
        list is transmitted by the at least one data consumer entity to the aggregator,
        and the aggregator forwards the list to the at least one data source entity.<br
        /> 6. The method of claim 1, wherein the steps of formulating the query and
        generating the list are performed by at least one data consumer entity having
        the initial set of privacy-sensitive data.<br /> 7. The method of claim 6,
        wherein the list is transmitted by the at least one data consumer entity directly
        to the at least one data source entity.<br /> 8. The method of claim 6, wherein
        the list is transmitted by the at least one data consumer entity to the aggregator,
        and the aggregator forwards the list to the at least one data source entity.<br
        /> 9. The method of claim 1, wherein the step of formulating the query is
        performed by the aggregator, and the step of generating the list is performed
