        entity or entities. However, another embodiment is also described below, wherein
        the aggregator processor does not have full access to the information at either
        the data consumer entity/entities or the data source entity/entities--because
        the information at both the data consumer entity/entities (and/or the data
        originator entity/entities) and the data source entity/entities are privacy-sensitive
