        embodiments of the instant invention are convolutions of quasi-familiar software
        modules--allowing implementation to be straightforward in today''s data complexity
        environment.<br />SUMMARY OF THE INVENTION<br />[0035] The aforesaid longstanding
        needs are significantly addressed by embodiments of the present invention,
        which specifically relates to The Privacy Preserving Data-Mining Protocol.
        The instant protocol is especially useful in society-computer interactions
