        Thus, it is accurate to summarize that the fundamental embodiments of the
        Privacy Preserving Data-Mining Protocol of the instant invention operate between
        a secure &quot;aggregator&quot; data processor and at least one secure &quot;source-entity&quot;
        data processors. The &quot;aggregator&quot; and the &quot;source-entity&quot;
        processors are interconnected via an electronic data-communications topology.
        The protocol is characterized by including the data-communications coordinated
        steps of: the at least one mutually independent secure &quot;source-entity&quot;
        data processors respectively forming a file by &quot;crunching together&quot;
        data-items according to a parameter list, and thereafter respectively filtering
        out portions of the file which characterize details particular to less than
        a predetermined quantity of micro-data-specific data-items; and the secure
        &quot;aggregator&quot; data processor aggregating the plurality of files into
        a data-warehouse.<br />[0075] Embodiments of the protocol of the instant invention
        are applicable to many arms-length data rights relationships, including (for
        example) those that exist between healthcare providers, pharmacies, PBMs or
        Health Maintenance Organizations (HMOs) &amp; Pharmaceutical-Companies; electronic
        commerce &amp; market research; banking &amp; insurance; census bureau &amp;
        other government agencies; auditors &amp; independent procurement/service
        organizations; and the likes.<br />[0076] A further class of embodiments of
        the Privacy Preserving Data-Mining Protocol of the present invention is worthy
        of note; and these are interim data merger enabled embodiments. Simply stated,
        these embodiments allow for the linkage of data items as related to a common
        entity. For example, an individual was a regular member of a first health
        care medical expense insurance plan and then switched to become a member of
        a second health care medical expense insurance plan. If the data sources are
        careful to encrypt the identifying portions of each record using a common
        encryption &quot;key&quot;, then further down the data processing circuit
        it will be possible to link records related to a common individual without
        compromising the identity of that individual. Of course, special care must
        be taken that the entity performing the linkage is not capable of knowing
        the key and decryption function; because knowing these facets would enable
        a breach of the individual''s privacy. (Note: U.S. Pat. No. 6,397,224 considered
        some aspects of using third party key holding to respect individual privacy--albeit
        without facilitating anonymous linkages between a plurality of data records.)<br
        />[0077] Returning now to FIGS. 3 and 8 (and Mutatis Mutandis to their respective
        program storage devices), it can now be appreciated that there are numerous
        locations where an encryption of individual identification and/or merger of
        data for individuals could be facilitated. By way of non-limiting example,
        on the &quot;aggregator&quot; processor side, the encryption and/or merger
        could be enable during the sub-steps: receiving a respective file, or aggregating
        the plurality of files; or on the &quot;source-entity&quot; processors'' side,
        the encryption and/or merger could be enabled during the sub-steps: organizing
        the data-items, forming a file, or filtering out portions of the file.<br
        />[0078] Thus there are at least two different situations where data from
        the data source is returned already aggregated, after analysis as well as
        a second option where data is release at the micro-level (each person''s data),
        but the person identity information, for the matched population, is replaced
        with a unique encryption key, such as a one way hash or Advanced Encryption
        Standard (AES) or the likes. This compatible encryption for the identifying
        micro-level data preserves the ability to know that the two records belong
        to the same identity, but preserve the privacy of the identity of that person.
        Each situation has viable options, albeit with respectively different advantages
        and disadvantages.<br />[0079] According to the preferred variation of this
        interim data merger enabled class of embodiments, the ability to link micro-level
        records related to the same identity at the data aggregator level is preserved--even
        if the records came from two different data sources.<br />[0080] Recall, at
        substantially each data source there is performed a name matching to identify
        all of the records for a certain identity (e.g. for Jane Doe). In that identity
        matching, the result may be several combinations of personal identifiers for
        the same person--for example (Jane Doe, (Boston, Mass.), health-plan ID 1234)
        and (Jane Doe, (New York, N.Y.) health-plan ID 5678) may both appear in a
        single data source. Since the name matching preferably has &quot;fuzzy logic&quot;,
        the software in the data source will find both. When releasing data from the
        data source to the data aggregator, the personal IDs will be encrypted--but
        using the same key in all data sources--a key that will preferably not be
        known to the Crossix protocol operator, but only a trusted third party such
        as an escrow agent. Now assume that a second data source also had data for
        (Jane Doe, (New York, N.Y.) health-plan ID 5678).<br />[0081] Now, at the
        data aggregator, data will be received from each data source, and the desire
        is to know that one instantiation with variation of Jane Doe is the same as
        another for a second data source. The way to achieve that is to encrypt more
        than a single ID for each person--so in the data released from the first data
        source--we will get both keys and the healthcare data (WXYZ (key1), ABCD (key2),
        other de-identified healthcare data) and from the second data source we will
        get (WXYZ, other de-identified healthcare data). Because of the fact that
        we encrypt several key that can uniquely identify the person, we can link
        their healthcare record for a more complete analysis. For example, if a person
        filled a prescription in one pharmacy, took a job with another employer (and
        therefore received a new health plan ID) but still used the same pharmacy,
        and eventually moved to another city; then, using the current merger embodiment,
        one could analyze whether that person is compliant and persistent in refilling
        the prescription for his medication (an important healthcare datum for that
        person)--even though the identity of that person is not knowable to the analyzer.<br
        />[0082] Thus, it should be apparent to the ordinary man of the art that the
