        a social problem (as recorded in countless private data-banks) without needing
        a search warrant for any specific individual or class or individuals, and
        similar heretofore detail-opaque query and answer data opportunities. Thus,
        it is anticipated that at least one of an at least two electronic data providers
        is selected from the list: data source entity, data consumer entity, health
        program, pharmaceutical manufacturer/distributor, public health regulator/monitor;
        credit card bureau, market research organization, banking consortium, census
        bureau, government agency, or the likes.<br />[0086] A further example, relates
        to the inclusion of at least a predetermined minimum number of individuals
        (identified by name or ID, address, phone number, date of birth, e-mail or
        the likes or a combination thereof) into a &quot;parameter list&quot; (that
        is formed or transmitted in the instant protocol)--and these individuals may
        be persons or legal entities or individual motor vehicles or individual computers
        or serial numbering industrial products or legal registration numbers or license
        numbers or the likes. Returning to the above-mentioned aspects of preferable
        encryption, it is certainly strongly advised that regardless of the general
        level of encryption elected, a parameter list including &quot;individuals&quot;
        should carry a stronger level of encryption. Nevertheless, in each &quot;query
        relationship&quot; there are different legal standards which may be applicable--such
        as in health care in the USA, interim between-party results must be HIPAA
        (Health Insurance Portability and Accountability Act of 1996) de-identified
        without micro-data specific content or substantially equivalently provably
        statistically intractable.<br />[0087] Thus, in describing the present invention,
        explanations are presented in light of currently accepted Data-Processing
        theories and Legal-Privacy models. Such theories and models are subject to
        quantitative (computational) &amp; qualitative (cultural) changes, both adiabatic
        and radical. Often these changes occur because representations for fundamental
        component elements are innovated, because new transformations between these
        elements are conceived, or because new interpretations arise for these elements
        or for their transformations. Therefore, it is important to note that the
        present invention relates to specific technological actualization in embodiments.
        Accordingly, theory or model dependent explanations herein, related to these
        embodiments, are presented for the purpose of teaching, the current man of
        the art or the current team of the art, how these embodiments may be substantially
        realized in practice. Alternative or equivalent explanations for these embodiments
        may neither deny nor alter their realization.<br />[0088] A further embodiment
        of the present invention is shown in FIGS. 9 and 10. In this embodiment, the
        aggregator processor does not have access to the information at either the
        data consumer entity/entities (and/or the data originator entity/entities)
        or the data source entity/entities. This embodiment can be thought of as &quot;double-blinded&quot;
        because the aggregator processor is blind to both the privacy-sensitive information
        at the data consumer entity/entities (and/or the data originator entity/entities)
        and the privacy-sensitive information at the data source entity/entities.
        Yet, the aggregator processor does have access to the matched and de-identified
        results of the query, so that the aggregator processor can analyze those results
        and deliver the final analysis result to the data consumer entity/entities.
        In contrast, the other embodiments can be thought of as &quot;single-blinded&quot;
        because the aggregator processor is blind to the privacy-sensitive information
        at the data source entity/entities, although the aggregator does have access
        to the information at the data consumer entity/entities (and/or the data originator
        entity/entities) despite its privacy-sensitive nature.<br />[0089] The double-blinded
        embodiment is used in situations where the information at the data consumer
        entity/entities (and/or the data originator entity/entities) is sensitive,
        and not even the aggregator should have exposure to it. A good example of
        such a situation is where the data consumer entity is a cable TV company that
        has detailed records (possibly second-by-second) of household cable-box channel
        settings, household billing information and advertising schedules (i.e., which
        ads were broadcasted on what channel at what time). In other words, the cable
        company information reveals what TV show or other entertainment content a
        particular household was watching at a particular time, and through this information
        it can be deduced which advertisements that particular household was exposed
        to. The cable company''s information is privacy sensitive and can not be released
        to the aggregator as is, because it contains the family name, their address,
        or other identifying indicia along with information about the family''s viewing
        habits that the family may not wish to be known. Indeed, the cable TV company
        may also wish the viewing habits of specific families to remain private, in
        order to avoid the negative publicity should it become known that the cable
        TV company did not keep such information private.<br />[0090] Other examples
        of data consumer entities that potentially have privacy-sensitive information
        which cannot be revealed to the aggregator include credit card companies,
        airline companies, auto rental companies, publisher and online media companies
        as well as healthcare companies such as pharmacies, hospitals and managed
        care organizations. When a healthcare company is the data consumer entity,
        the need to keep its information private from even the aggregator is particularly
        acute, since various laws and regulations including HIPAA may require complete
        privacy.<br />[0091] Another reason the information at the data consumer entity
        could be privacy-sensitive is that it may not even be the data consumer entity''s
        own information. Instead, the information may be acquired by the data consumer
        entity from a third party who requires that the information be kept private.
        Or, this &quot;originating information&quot; may not be available to the data
        consumer entity at all, and may instead be provided by a data originator entity
        who is a third party unconnected with the data consumer entity. This latter
        situation is shown in FIGS. 11 and 12, and is exemplified by the following
        situation: let''s say the data consumer entity is a pharmaceutical company
        that wishes to have a certain business question answered. The pharmaceutical
        company does not have access to originating information, and the originating
        information is instead provided by a third party--for example a cable TV company--with
        suitable information that can generate a list of specific instances which
        meet the conditions in the query. In this situation, the data consumer entity
        is not involved in generating the list at the front end of the process. However,
        the data consumer entity of course still receives the analysis results from
        the aggregator at the back end of the process, so that the data consumer entity''s
        business question is answered.<br />[0092] It should also be understood that
        the situation discussed above, wherein the data consumer entity does not have
        access to any or all of the originating information, and at least some of
        the originating information is instead provided by a third party--a &quot;data
        originator entity&quot;--with suitable information that can generate a list
        of specific instances which meet the conditions in the query, can also exist
        for the single-blinded embodiments described herein. Said another way, the
        situation wherein a separate data originator entity (not the data consumer
        entity) supplies the originating information can exist in cases where the
        originating information can be shared with the aggregator, and cases where
        it cannot.","backgroundTextHtml":"CROSS-REFERENCES TO RELATED APPLICATIONS\n[0001]
